import React, { Component } from 'react';

class Like extends Component {
  render() {
    let classes = 'fa fa-heart';
    if (!this.props.liked) classes += '-o';
    return (
      <div>
        <i class="fa fa-heart-o" aria-hidden="true"></i>
      </div>
    );
  }
}

export default Like;
